import {Navbar, Container, Nav, Image, Row, Col} from 'react-bootstrap';
import {Link} from 'react-router-dom';

function NavegationBar(){
    return(
        <Navbar bg="dark" expand="lg" variant='dark'>
            <Container>
                <Col >
                    <Image src={require('../images/TazasFondoNegro.png')} className="img-fluid " width="30%" alt="taza"></Image>
                </Col>
                <Col>
                    <Navbar.Brand href="#home">Rec Sublime</Navbar.Brand>
                </Col>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="me-auto">
                    <Nav.Link href="#home">Home</Nav.Link>
                    <Nav.Link href="https://www.instagram.com/rec_sublime_/?hl=es-la" target="_blank">Instagram</Nav.Link>
                </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>
    );
}

export default NavegationBar;
